CREATE DEFINER = 'dev'@'%'
PROCEDURE Proc_pagingEmployee (IN m_PageIndex int, IN m_PageSize int, IN m_EmployeeFilter varchar(255), OUT m_TotalRecords int, OUT m_TotalPages int, IN m_BankName varchar(255), IN m_Gender int, IN m_DepartmentId char(36), IN m_IsOrganizations int)
COMMENT 'Proc for Searching and Paginating Employee Data'
BEGIN
  SET @EmployeeFilter = (SELECT
      m_EmployeeFilter);
  SET @BankName = (SELECT
      m_BankName);
  SET @Gender = (SELECT
      m_Gender);
  SET @DepartmentId = (SELECT
      m_DepartmentId);
  SET @IsOrganizations = (SELECT
      m_IsOrganizations);


  SET m_TotalRecords = (SELECT
      COUNT(*)
    FROM Employee e
    WHERE ((@EmployeeFilter IS NULL)
    OR (e.EmployeeCode LIKE CONCAT('%', @EmployeeFilter, '%')
    OR e.EmployeeName LIKE CONCAT('%', @EmployeeFilter, '%')
    OR e.PhoneNumber LIKE CONCAT('%', @EmployeeFilter, '%')))
    AND (@BankName IS NULL
    OR e.BankName = @BankName)
    AND (@Gender IS NULL
    OR e.Gender = @Gender)
    AND (@DepartmentId IS NULL
    OR e.DepartmentId = @DepartmentId));

  IF (m_PageIndex IS NULL
    OR m_PageIndex < 1
    OR m_PageSize IS NULL
    OR m_PageSize < 1) THEN
    SET m_TotalPages = 1;
    SET m_PageIndex = 1;
    SET m_PageSize = m_TotalRecords;
  END IF;

  CREATE TEMPORARY TABLE IF NOT EXISTS tempEmployee AS
  SELECT
    @row_index := @row_index + 1 AS SortIndex,
    ve.*
  FROM View_Employee ve,
       (SELECT
           @row_index := 0 AS RowIndex) AS c
  WHERE ((@EmployeeFilter IS NULL)
  OR (ve.EmployeeCode LIKE CONCAT('%', @EmployeeFilter, '%')
  OR ve.EmployeeName LIKE CONCAT('%', @EmployeeFilter, '%')
  OR ve.PhoneNumber LIKE CONCAT('%', @EmployeeFilter, '%')
  ))
  AND (@BankName IS NULL
  OR ve.BankName = @BankName)
  AND (@Gender IS NULL
  OR ve.Gender = @Gender)
  AND (@DepartmentId IS NULL
  OR ve.DepartmentId = @DepartmentId)
  AND (@IsOrganizations IS NULL
  OR ve.IsOrganizations = @IsOrganizations)
  ORDER BY ve.CreatedDate DESC;

  SET @EndIndex = m_PageSize * m_PageIndex;
  SET @StartIndex = @EndIndex - m_PageSize + 1;

  SELECT
    *
  FROM tempEmployee
  WHERE SortIndex BETWEEN @StartIndex AND @EndIndex
  ORDER BY SortIndex ASC;

  SET @CurNumEmployees = (SELECT
      COUNT(*)
    FROM tempEmployee);

  IF (m_PageIndex IS NULL
    OR m_PageIndex < 1
    OR m_PageSize IS NULL
    OR m_PageSize < 1) THEN
    SET m_TotalPages = 1;
    SET m_PageIndex = 1;
    SET m_PageSize = m_TotalRecords;
  ELSE
    SET @Remainder = (@CurNumEmployees % m_PageSize);
    IF (@Remainder > 0) THEN
      SET m_TotalPages = @CurNumEmployees DIV m_PageSize + 1;
    ELSE
      SET m_TotalPages = @CurNumEmployees DIV m_PageSize;
    END IF;
  END IF;

  DROP TABLE tempEmployee;

END
$$

